package qwert.register.successRegister;import com.fasterxml.jackson.annotation.JsonProperty;public class SuccessRegistrationResponseFields {    @JsonProperty("id")    private Integer id;    @JsonProperty("token")    private String token;    public SuccessRegistrationResponseFields(Integer id, String token){        this.id = id;        this.token = token;    }    public Integer getId() {        return id;    }    public String getToken() {        return token;    }    public SuccessRegistrationResponseFields() {    }}